This arc was collected as a trade paperback in September 1994, and a new edition was released in January 2005.

&quot;Maximum Carnage&quot; is a fourteen-part comic book crossover published in Marvel Comics's Spider-Man family of titles in 1993. It featured Spider-Man and Venom teaming up to face Venom's murderous offspring Carnage.
